import { Route, Switch, Router } from "react-router-dom";
import Dashboard from "../pages/Dashboard";
import AppointmentPage from "../pages/AppointmentPage";
import ProfilePage from "../pages/ProfilePage";
import Login from "../pages/Login";
import InfoBox from "./profileComponents/InfoBox";
import Notifications from "../pages/Notifications";
import CoursePage from "../pages/CoursePage";
import { Redirect } from "react-router-dom";
import NewSeatingPlanForm from "./profileComponents/NewSeatingPlanForm";
import MenuTab from "./MenuTab";
import CourseService from "../../service/CourseService";
import { useEffect, useState } from "react";

const AppRouter = () => {
  const [courses, setCourses] = useState([]);

  const fetchData = async () => {
    let list = await CourseService.getAllCourses();
    setCourses([
      {
        courseCode: "cs319",
      },
      {
        courseCode: "cs315",
      },
      {
        courseCode: "math225",
      },
    ]);
  };

  useEffect(() => {
    fetchData().then();
  }, []);

  return (
    <Switch>
      <Route path="/login">
        <Login />
      </Route>
      <Route path="/home">
        <MenuTab />
        <Dashboard />
      </Route>
      <Route path="/appointment">
        <MenuTab />
        <AppointmentPage />
      </Route>
      <Route path="/profile">
        <MenuTab />
        <ProfilePage id="1" />
      </Route>
      <Route path="/campusmap">
        <MenuTab />
        <Login />
      </Route>
      <Route path="/notifications">
        <MenuTab />
        <Notifications />
      </Route>
      {courses.map((course) => {
        return (
          <Route path={"/course/".concat(course.courseCode)}>
            <MenuTab />
            <CoursePage />
          </Route>
        );
      })}
      <Redirect to="/login" />
    </Switch>
  );
};
export default AppRouter;
